"use strict";

/*!
 * Custom scripts
 */
(function () {
  //===== Input mask telephone =====//
  var inputTel = document.querySelector('.input-tel');

  if (inputTel) {
    Inputmask({
      'mask': '+7 (999) 999-9999'
    }).mask(inputTel);
  } //===== Dropdawn select =====//


  var inputSelectEl = document.querySelector('.input-select');

  if (inputSelectEl) {
    new Choices(inputSelectEl, {
      searchEnabled: false,
      itemSelectText: '',
      shouldSort: false
    });
  } //===== Site Vue =====//


  Vue.config.devtools = true;
  var APP_LOG_LIFECYCLE_EVENTS = false;
  var dataSite = {
    phoneDevice: window.innerWidth < 768 ? true : false,
    tabletDevice: window.innerWidth < 1024 ? true : false,
    mobileMenu: false
  };
  var site = new Vue({
    el: '#site',
    data: dataSite,
    methods: {
      watchSiteSize: function watchSiteSize() {
        if (window.innerWidth < 768) {
          this.phoneDevice = true;
        } else {
          this.phoneDevice = false;
          this.mobileMenu = false;
        }

        this.tabletDevice = window.innerWidth < 1024 ? true : false;
      },
      toggleMobileMenu: function toggleMobileMenu(e) {
        e.preventDefault();
        this.mobileMenu = this.mobileMenu ? false : true;
      }
    },
    beforeCreate: function beforeCreate() {
      //For debugging
      if (APP_LOG_LIFECYCLE_EVENTS) console.log('beforeCreate');
    },
    created: function created() {
      window.addEventListener('resize', this.watchSiteSize); //For debugging

      if (APP_LOG_LIFECYCLE_EVENTS) console.log('created');
    },
    beforeMount: function beforeMount() {
      //For debugging
      if (APP_LOG_LIFECYCLE_EVENTS) console.log('beforeMount');
    },
    mounted: function mounted() {
      //For debugging
      if (APP_LOG_LIFECYCLE_EVENTS) console.log('mounted');
    },
    beforeUpdate: function beforeUpdate() {
      //For debugging
      if (APP_LOG_LIFECYCLE_EVENTS) console.log('beforeUpdate');
    },
    updated: function updated() {
      //For debugging
      if (APP_LOG_LIFECYCLE_EVENTS) console.log('updated');
    },
    beforeDestroy: function beforeDestroy() {
      //For debugging
      if (APP_LOG_LIFECYCLE_EVENTS) console.log('beforeDestroy');
    },
    destroyed: function destroyed() {
      window.removeEventListener('resize', this.watchSiteSize); //For debugging

      if (APP_LOG_LIFECYCLE_EVENTS) console.log('destroyed');
    }
  });
})();